&lt;p&gt;&lt;a href="http://www.flickr.com/people/psychedelic_skyler/"&gt;Skyyitalia&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/psychedelic_skyler/4974479028/" title="Justin"&gt;&lt;img src="http://farm5.static.flickr.com/4125/4974479028_a95ee6fdb1_m.jpg" width="240" height="160" alt="Justin" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;After a night of craziness and fun Justin and I needed to ease our hangover with some steady toking at 6am so we could start the day...&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/people/psychedelic_skyler/"&gt;Skyyitalia&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/psychedelic_skyler/4974479266/" title="And the Day Starts..."&gt;&lt;img src="http://farm5.static.flickr.com/4103/4974479266_06efa9bbbc_m.jpg" width="240" height="160" alt="And the Day Starts..." /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;What better way to start your Wednesday than with a phone call at 11am telling you to wake up and come take target practice at Garfield? Having a nice &amp;quot;Wake N' Bake&amp;quot; session right before... Heres a nice shot of Kyle taking an axe to Garfields head, Enoy... :)&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/people/psychedelic_skyler/"&gt;Skyyitalia&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/psychedelic_skyler/4974479476/" title="James"&gt;&lt;img src="http://farm5.static.flickr.com/4132/4974479476_c11d9a1f0c_m.jpg" width="240" height="160" alt="James" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;After mercilessly shooting, stabbing, beating and tagging Garfield we decided to take a break... James has that mad &amp;quot;Dragon Breathe&amp;quot; in this frame...&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/people/cookieduster/"&gt;CookieDuster&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/cookieduster/5132717585/" title="Legal Bong Hit"&gt;&lt;img src="http://farm5.static.flickr.com/4004/5132717585_06081c0012_m.jpg" width="240" height="161" alt="Legal Bong Hit" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;Yes, California is full of pot heads, and many of them vote.&lt;br /&gt;
&lt;br /&gt;
Yay Free Speech!&lt;br /&gt;
&lt;br /&gt;
Happy to see this guy on Sunday with a big-ass sign supporting Proposition 19, intended to legalize marijuana in California.&lt;br /&gt;
&lt;br /&gt;
&amp;quot;Vote yes on prop 19 on Tuesday and I'll give you a legal bong hit on Wednesday.&amp;quot;&lt;br /&gt;
&lt;br /&gt;
He said that someone had asked him what a bong hit was.&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/people/cookieduster/"&gt;CookieDuster&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/cookieduster/5132717705/" title="Legalize Pot"&gt;&lt;img src="http://farm2.static.flickr.com/1075/5132717705_c2acfb32df_m.jpg" width="240" height="161" alt="Legalize Pot" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;The conversation was not about smoking a joint at the time but the gesture seemed to come to him quite naturally.&lt;br /&gt;
&lt;br /&gt;
&amp;quot;Vote yes on prop 19 on Tuesday and I'll give you a legal bong hit on Wednesday.&amp;quot;&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/people/cookieduster/"&gt;CookieDuster&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/cookieduster/5133319446/" title="Far Out, Man"&gt;&lt;img src="http://farm5.static.flickr.com/4110/5133319446_eeef1c6615_m.jpg" width="171" height="240" alt="Far Out, Man" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;My conversation with the Prop 19 supporter revealed that he was mostly interested in it as an industry. The t-shirt reads &amp;quot;Humboldt&amp;quot; on the sleeve.&lt;br /&gt;
&lt;br /&gt;
&amp;quot;Vote yes on prop 19 on Tuesday and I'll give you a legal bong hit on Wednesday.&amp;quot;&lt;/p&gt;
